import React from 'react';

class Stocks extends React.Component {

  handleChange(event) {
    console.log(event.target.value)
  }
  render() {
    const { stockBought } = this.props;
    return (
      <tbody>
        {stockBought.map((e) => 
          <tr key={e.nome}>
            <td>{e.nome}</td>
            <td>{e.codigo}</td>
            <td>{e.quantidade}</td>
            <td>{e.precoCompra}</td>
            <td>12</td>
            <td onChange={this.handleChange}>{`${((12 - e.precoCompra) / e.precoCompra) * 100} %`}</td>
          </tr>
        )}
      </tbody>
    )
  }
}

export default Stocks;
